INSERT INTO `tbl_pages` VALUES (1,'About Us','Main','about','<h2 style=\"margin-bottom: 0cm; line-height: 100%;\"><font face=\"georgia\" size=\"3\"><font style=\"\">Food\r\nOrdering Marketplace is one of the best and convenient food ordering\r\nwebsite. We connect people to their </font><font style=\"\">favorite</font><font style=\"\">\r\nrestaurants in the city. </font><font style=\"\">Our\r\nvast&nbsp;<br></font></font><font face=\"georgia\" size=\"3\"><font style=\"\">community of food lovers share their reviews, so you have all\r\nthat you need to make an informed choice.</font></font></h2><h2 style=\"margin-bottom: 0cm; line-height: 100%;\"><font face=\"georgia\" size=\"3\"><br></font><font face=\"georgia\" size=\"3\"><font style=\"\">We\r\nbelieve in the delight of food and that food ordering should be fast\r\nand definitely a good experience. Ordering on </font><font style=\"\">Food\r\nOrdering Marketplace </font><font style=\"\">is\r\nan&nbsp;<br></font></font><font style=\"\" face=\"georgia\" size=\"3\">easy four step process :<br></font><font face=\"georgia\" size=\"3\"><font style=\"\">1.\r\n</font><font style=\"\">Choose\r\nyour area\r\n and desirable\r\n Restaurant<br></font></font><font style=\"\" face=\"georgia\" size=\"3\">2.\r\nGo through the menu and add the dishes to the cart<br></font><font style=\"\" face=\"georgia\" size=\"3\">3.\r\nEasily pay for the food<br></font><font face=\"georgia\" size=\"3\"><font style=\"\">4.\r\nGet food delivered to your doorstep </font></font></h2>\r\n<p style=\"margin-bottom: 0cm; line-height: 100%\"><br>\r\n</p>',1,'2017-09-01 15:29:07','0000-00-00 00:00:00'),(3,'Terms and Conditions','Main','terms_and_conditions','	\r\n	\r\n	\r\n\r\n\r\n<h4 style=\"margin-bottom: 0cm; line-height: 100%;\"><p class=\"MsoNormal\" style=\"margin-bottom: 16pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-o