\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">1.2. Service: We provide a way for you to communicate your\r\norders (\"Orders\") for products (\"Products\") to delivery or\r\ntakeaway restaurants (\"Restaurants\") displayed on the Website (the\r\n\"Service\").<o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">&nbsp;</span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"color: rgb(121, 120, 118); font-family: Helvetica, sans-serif;\">2. WEBSITE ACCESS AND TERMS</span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">2.1. Website access: You may access some areas of the Website without\r\nmaking an Order or registering your details with us. Most areas of the Website\r\nare open to everyone.&nbsp;</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">When you use the Website or register an account, you will\r\nprovide us with personal information such as your name, email address,\r\ntelephone number, credit or debit card information and address. You must ensure\r\nthat this information is accurate and current. We will handle all personal\r\ninformation we collect in accordance with our&nbsp;</span><a href=\"https://www.online-order.menu/privacy_policy\"><span style=\"font-family:\r\n\" helvetica\",sans-serif;color:#797876\"=\"\">Privacy Policy</span></a><span style=\"font-family:\" helvetica\",sans-serif;color:#333333\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">If you choose to register an account or when you place your\r\nfirst order, we will provide you with a user name and you will select a\r\npassword. You are responsible for keeping this user name and password secure\r\nand are responsible for all use and activity carried out under this user name.</span><span style=\"font-family:\" helvetica\",sans-serif;color:#333333\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">2.2. Acceptance of terms: By accessing any part of the Website,\r\nyou indicate that you accept these Website Terms. If you do not accept these\r\nWebsite Terms, you should leave the Website immediately, and you will not be\r\nable to order any Products through the Website.</span><span style=\"font-family:\r\n\" helvetica\",sans-serif;color:#333333\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">2.3. Revision of terms: We may revise these Website Terms at any\r\ntime. You should check the Website regularly to review the current Website\r\nTerms because they are binding on you. You will be subject to the terms and\r\nconditions in force at the time that you place an Order through us.</span><span style=\"font-family:\" helvetica\",sans-serif;color:#333333\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">2.4. Responsibility: You are responsible for making all\r\narrangements necessary for you to have access to the Website. You are also\r\nresponsible for ensuring that all persons who access the Website through your\r\nInternet connection are aware of these Website Terms and that they comply with\r\nthem.</span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\"><br></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"color: rgb(121, 120, 118); font-family: Helvetica, sans-serif;\">3. YOUR STATUS</span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">3.1. Capacity and age: By placing an Order through the Website,\r\nyou warrant that:</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">3.1.1. You are legally capable of entering into binding\r\ncontracts; and&nbsp;</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">3.1.2. You are at least 18 years old.</span><span style=\"font-family:\" helvetica\",sans-serif;color:#333333\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">3.2. Alcohol and cigarettes: Furthermore, you acknowledge and\r\nagree that:&nbsp;</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">3.2.1. it is an offense for any person under the age of 18 to\r\nbuy, or attempt to buy, intoxicating liquor, or for any person over the age of\r\n18 to buy intoxicating liquor on behalf of any person under the age of 18;</span><span style=\"font-family:\" helvetica\",sans-serif;color:#333333\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">3.2.2. Cigarettes are not for sale to persons under the age of\r\n18; and</span><span style=\"font-family:\" helvetica\",sans-serif;color:#333333\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">3.2.3. Orders containing either alcohol or cigarettes can\r\ntherefore not be accepted from or on behalf of persons under the age of 18. In\r\nthe event that you place an order for alcohol or tobacco products, you will be\r\nrequired by the restaurant to show ID on delivery. For the avoidance of doubt,\r\nif your Order includes alcohol or tobacco, the Restaurant is providing you with\r\nthese and Online-Order.menu is not selling alcohol or tobacco to you. Online-Order.menu\r\nsupports the Responsible Service of Alcohol.</span><span style=\"font-family:\r\n\" helvetica\",sans-serif;color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">4. HOW TO MAKE AN ORDER AND HOW IT IS PROCESSED</span><span style=\"font-family:\" helvetica\",sans-serif;color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">4.1. Compiling your Order: Once you select the Products you wish\r\nto order from the menu of your chosen Restaurant and provide other required\r\ninformation, you will be given the opportunity to submit your Order by clicking\r\nor selecting the \"proceed\", \"place my order\",\r\n\"checkout\" or similar button. It is important that you check all the\r\ninformation that you enter and correct any errors before clicking or selecting\r\nthis button; once you do so we will process your Order and errors cannot be\r\ncorrected.</span><span style=\"font-family:\" helvetica\",sans-serif;color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">4.2. Minimum Order Amount: If a Restaurant has a minimum order\r\namount in place, you may not place an order with that Restaurant until the\r\nvalue of your Order exceeds that amount. The minimum order amount must be met\r\nafter applying any discounts or specials that reduce the total Order amount.&nbsp;</span><span style=\"font-family:\" helvetica\",sans-serif;color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">4.3. Amending or canceling your Order: Once you submit your\r\nOrder and your payment have been authorized, you will not be entitled to change\r\nor cancel your Order online (please refer to paragraph 4.4 for details of the\r\nprocess relating to rejected Orders). If you wish to change or cancel your\r\nOrder, you may contact the Restaurant directly. </span><span style=\"font-family:\r\n\" helvetica\",sans-serif;color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">4.4. Payment authorization: Where any payment you make is not\r\nauthorized, your Order will not be processed by or communicated to the relevant\r\nRestaurant.</span><span style=\"font-family:\" helvetica\",sans-serif;color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">4.5. Processing your Order and Restaurant rejections: On receipt\r\nof your order, we will begin processing it by sending it to the relevant\r\nRestaurant and will notify you by email that your order has been received and\r\nis being processed. Any confirmation page that you may see on the Website and\r\nany Order confirmation e-mail that you may receive each merely indicate that\r\nyour Order has been received and is being processed by us and does not\r\nnecessarily mean that your order has been accepted by the Restaurant.\r\nRestaurants have the discretion to reject Orders at any time because they are\r\ntoo busy, due to weather conditions or for any other reason. We encourage all\r\nour Restaurants to accept all Orders and to communicate any rejection promptly,\r\nand we will notify you (generally by email) as soon as reasonably practicable\r\nif a Restaurant rejects your Order.&nbsp; When a Restaurant confirms receipt of\r\nthe order and expected collection or delivery time, we will send you an SMS\r\nconfirmation (provided that you have given us your mobile telephone number).</span><span style=\"font-family:\" helvetica\",sans-serif;color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span helvetica\",sans-serif;=\"\" color:#797876\"=\"\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">4.6. Delivery of your Order: Estimated times for deliveries and\r\ncollections are provided by the Restaurants and are only estimates. Neither we\r\nnor the Restaurants guarantee that Orders will be delivered or will be\r\navailable for collection within the estimated times. All food preparation and\r\ndeliveries are the sole responsibility of the Restaurant accepting the Order.\r\nTo the extent permitted by law, including the Australian Consumer Law, Online-Order.menu\r\naccepts no liability associated with food preparation or delivery by the\r\nRestaurant accepting the order.</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p></h4><h4 style=\"margin-bottom: 0cm; line-height: 100%;\"><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">5. PRICE AND PAYMENT</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">5.1. Taxes and delivery costs: Prices for individual menu items\r\nwill be as quoted on the Website in Australian dollars. These prices include\r\nany applicable taxes but may exclude delivery costs (if you opt for delivery\r\ninstead of collection) and any online payment administration charge imposed by\r\nthe Restaurant (if you pay for your Order online). These will be added to the\r\ntotal amount due where applicable.</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">5.2. Incorrect pricing: This Website contains a large number of\r\nmenus and it is possible that some of the menus may include incorrect prices.\r\nThe products will be sold for the displayed price even if the correct price for\r\nan Order is higher than the price stated on the Website.</span><span style=\"font-family:\" helvetica\",sans-serif;color:#333333\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">5.3. Payment methods: Payment for Orders must be made by an\r\naccepted credit or debit card through the Website or in cash to the Restaurant\r\nat the point of delivery to you.&nbsp;</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">5.4. Card payments: If you pay by credit or debit card, you may\r\nbe required to show the card to the Restaurant at the time of delivery as proof\r\nof identification and so that they can check that the card conforms with the\r\nreceipt data for the Order. Please note that from time to time there may be\r\ndelays with the processing of card payments and transactions; this may result\r\nin delays in sums being deducted from your bank account or charged to your\r\ncredit or debit card.</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">5.5. Credit and discount vouchers: A credit or discount may\r\napply to your Order if you use a promotional voucher or code recognised by the\r\nWebsite and endorsed by Online-Order.menu, and you pay for any balance by\r\ncredit or debit card. Please refer to our Voucher Terms &amp; Conditions for\r\nthe full terms and conditions applicable to the use of credit and discount\r\nvouchers.</span><span style=\"font-family:\" helvetica\",sans-serif;color:#333333\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">5.6. Rejected Orders: Once you have submitted an Order that you\r\nare paying for by credit or debit card and your payment has been authorised,\r\nyou will be charged the full amount of your Order. If your Order is\r\nsubsequently rejected by the Restaurant (as described in paragraph 4.4 above)\r\nor cancelled for any other reason, your bank or card issuer will refund the\r\nrelevant amount. However, this may take between 3 to 5 working days (or longer,\r\ndepending on your bank or card issuer). You acknowledge and agree that neither\r\nwe nor the relevant Restaurant will be responsible or liable to you in relation\r\nto this delay by your bank or card issuer in the release of funds back into\r\nyour account.</span><span style=\"font-family:\" helvetica\",sans-serif;color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">6. CUSTOMER SERVICE</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">6.1. General: Customer service is extremely important to us.\r\nSubject to paragraphs 6.5 and 11, our Customer Service team will therefore try\r\nto assist you where possible if you have any problems with your Order. You can\r\ncontact our Customer Service team by emailing us shown under the \"About\r\nus\" link on the Website. Alternatively, you can access the list of\r\nfrequently asked questions&nbsp;</span><a href=\"https://www.online-order.menu/faq\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">FAQ</span></a><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span helvetica\",sans-serif;=\"\" color:#797876\"=\"\">\r\n\r\n\r\n\r\n</span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">6.2. Questions about your Order: If your Order is taking longer\r\nthan expected or you have any other problems with your Order, in the first instance\r\nyou should contact the Restaurant directly. Alternatively, you can contact our\r\nCustomer Service Team as described above and one of our Customer Service\r\nAdvisers will attempt to contact the Restaurant in order to follow up on your\r\nquery.</span><span style=\"font-family:\" helvetica\",sans-serif;color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">6.3. Changing or cancelling your Order: If you wish to change or\r\ncancel your Order after it has been submitted and payment has been authorised,\r\nyou may contact our Customer Service team as described above and they will\r\nattempt to contact the Restaurant in order to communicate your requests.\r\nHowever, there is no guarantee that we will be able to reach the Restaurant or\r\nthat the Restaurant will agree to your requests as they may have already\r\nstarted to process your Order.</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">6.4. Complaints or feedback: In the event that you would like to\r\nexpress your opinion on the quality of any Products or the service provided by\r\na Restaurant, please consider providing feedback in the form of ratings,\r\ncomments and reviews on the Website. The Reviews are an important part of our\r\nquality control process.&nbsp;</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span helvetica\",sans-serif;=\"\" color:#797876\"=\"\">\r\n\r\n\r\n\r\n</span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">6.5. Compensation: If you are dissatisfied with the quality of\r\nany Products or the service provided by a Restaurant and wish to seek a refund,\r\na proportionate price reduction or any other compensation, you should contact\r\nthe Restaurant directly to lodge your complaint and, where appropriate, follow\r\nthe Restaurant\'s own complaint procedures. If you are unable to contact the\r\nRestaurant, or the Restaurant refuses to deal with your complaint, you can\r\ncontact our Customer Service Team as described above within 48 hours of placing\r\nyour Order and one of our Customer Service Advisers will attempt to contact the\r\nRestaurant in order to request compensation on your behalf. Please note that we\r\nhave no control over Restaurants and the quality of the individual Products or\r\nservice that they provide, and we not able to provide, and have no\r\nresponsibility or liability for providing, any compensation to you on behalf of\r\nany Restaurant.</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">7. LICENCE</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">7.1. Terms of permitted use: You are permitted to use the\r\nWebsite and print and download extracts from the Website for your own personal\r\nnon-commercial use on the following basis:</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">7.1.1. You must not misuse the Website (including by hacking or\r\n\"scraping\").</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">7.1.2. Unless otherwise stated, the copyright and other\r\nintellectual property rights in the Website and in material published on it\r\