l; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">10.4.4. The foregoing disclaimers do not affect your statutory\r\nrights against any Restaurant.&nbsp;</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span helvetica\",sans-serif;=\"\" color:#797876\"=\"\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">10.5. Exclusion of terms: We provide you with access to the\r\nWebsite and Service on the basis that, to the maximum extent permitted by law,\r\nincluding the Australian Consumer Law, we exclude all representations,\r\nwarranties, conditions, undertakings and other terms in relation to the Website\r\nand Service (including any representations, warranties, conditions,\r\nundertakings and other terms which might otherwise apply to the Website or\r\nService, or be otherwise implied or incorporated into these Website Terms, by\r\nstatute, common law or otherwise).</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">11. LIABILITY</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">11.1. General: Nothing in these Website Terms excludes or limits\r\nour liability for death or personal injury arising from our negligence, our\r\nliability for fraudulent misrepresentation, or any other liability which cannot\r\nbe excluded or limited under applicable law, including the Australian Consumer\r\nLaw. Nothing in these Website Terms affects your statutory rights, including\r\nright relating to the consumer guarantees applicable to the supply of services\r\nunder these Term.</span><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#333333\"=\"\"><o:p></o:p></span></p><p style=\"margin: 0cm 0cm 11pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family:\" helvetica\",sans-serif;=\"\" color:#797876\"=\"\">11.2. Exclusion of liability: Subject to clause 11.1, and your\r\nstatutory rights under the Australian Consumer Law more generally, we will\r\nunder no circumstances be liable to you, whether in contract, tort (including\r\nnegligence), breach of statutory duty, or otherwise, even if foreseeable,\r\narising under or in connection with the Service or the Website (including the\r\nuse, inability to use or the results of use of the Service or the Website) for:</span></p><p style=\"mar',1,'2019-10-16 17:10:10','0000-00-00 00:00:00'),(4,'Privacy Policy','Main','privacy_policy','	\r\n	\r\n	\r\n\r\n\r\n<h4 style=\"margin-bottom: 0cm; line-height: 100%\"><font size=\"3\" face=\"georgia\">We\r\nvalue the trust you place in us. That\'s why we insist upon the\r\nhighest standards for secure transactions and User information\r\nprivacy. Please read the following statement to learn about our\r\ninformation gathering and dissemination practices. The following\r\nPrivacy Policy should be read along with the Online-Order.Menu –\r\nTerms of Use for a full understanding of Online-Order.Menu\'s\r\npractices as well as the Users responsibilities when interacting with\r\nthe site.</font></h4><h4 style=\"margin-bottom: 0cm; line-height: 100%\"><font size=\"3\" face=\"georgia\"><br></font><font size=\"3\" face=\"georgia\">This\r\nPrivacy Policy is published in accordance with the provisions of the\r\nInformation Technology Act, 2000 and the rules made thereunder,\r\nspecifically, The Information Technology (Reasonable Security\r\nPractices and Procedures and Sensitive Personal data or information)\r\nRules, 2011 and the Information Technology (Intermediary Guidelines)\r\nRules, 2011.</font></h4><h4 style=\"margin-bottom: 0cm; line-height: 100%\"><font size=\"3\" face=\"georgia\"><br></font><font size=\"3\" face=\"georgia\">All\r\nterms used in this Privacy Policy will have the same meaning and\r\ndefinition assigned to them in the Information Technology Act, 2000\r\nand the rules made thereunder.</font></h4><h4 style=\"margin-bottom: 0cm; line-height: 100%\"><font size=\"3\" face=\"georgia\"><br></font><font size=\"3\" face=\"georgia\">Note:<br></font><font size=\"3\" face=\"georgia\">Our\r\nprivacy policy is subject to change at any time without notice. To\r\nmake sure you are aware of any changes, please review this policy\r\nperiodically.</font><font size=\"3\" face=\"georgia\"><br></font><font size=\"3\" face=\"georgia\">By\r\nvisiting this Website you agree to be bound by the terms and\r\nconditions of this Privacy Policy and the Terms of Use of the\r\nWebsite. If you do not agree please do not use or access the Website.</font></h4>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n',1,'2019-10-16 16:33:10','0000-00-00 00:00:00'),(5,'FAQ','Main','faq','	\r\n	\r\n	\r\n\r\n\r\n<h4 style=\"margin-bottom: 0cm; line-height: 100%\"><font size=\"3\" face=\"georgia\"><font><b>Question\r\n:</b></font><font>\r\nCan customer give a review/rating even if they have not ordered food\r\nfrom that restaurant?<br></font></font><font size=\"3\" face=\"georgia\"><font><b>Ans\r\n:</b></font><font>\r\nNo. The customer can only review/rate the restaurant once his order\r\nhas been delivered.</font></font></h4><h4 style=\"margin-bottom: 0cm; line-height: 100%\"><font size=\"3\" face=\"georgia\"><br></font><font size=\"3\" face=\"georgia\"><font><b>Question\r\n:</b></font><font>\r\nCan customer cancel a order once they have placed it?<br></font></font><font size=\"3\" face=\"georgia\"><font><b>Ans\r\n:</b></font><font>\r\nYes customer can cancel his order but only till the restaurant has\r\nnot confirmed it. Once the order is confirmed, customer cannot cancel\r\nit.</font></font></h4><h4 style=\"margin-bottom: 0cm; line-height: 100%\"><font size=\"3\" face=\"georgia\"><br></font><font size=\"3\" face=\"georgia\"><font><b>Question\r\n:</b></font><font>\r\nHow will the order be managed if the customer orders food from more\r\nthan one restaurants?<br></font></font><font size=\"3\" face=\"georgia\"><font><b>Ans\r\n:</b></font><font>\r\nWhen a customer will order food from multiple restaurants, the order\r\nwill be sub divided in between the restaurants. Although the customer\r\nwill only see one order.</font></font></h4><h4 style=\"margin-bottom: 0cm; line-height: 100%\"><font size=\"3\" face=\"georgia\"><br></font><font size=\"3\" face=\"georgia\"><font><b>Question\r\n: </b></font><font>\r\nCan restaurants decide not to take orders for a period of time\r\nsuppose like 2 hours?<br></font></font><font size=\"3\" face=\"georgia\"><font><b>Ans\r\n:</b></font><font>\r\nYes. If restaurants turn off their restaurant status, they would not\r\nbe displayed in the list of restaurants to order. Also restaurants\r\ncan cancel the received orders.</font></font></h4><h4 style=\"margin-bottom: 0cm; line-height: 100%\"><font size=\"3\" face=\"georgia\"><br></font><font size=\"3\" face=\"georgia\"><font><b>Question\r\n:</b></font><font>\r\nCan customer track their order status on the website?<br></font></font><font size=\"3\" face=\"georgia\"><font><b>Ans\r\n:</b></font><font>\r\nYes the customers can see if their order has been confirmed, canceled\r\nor delivered. Also, restaurants can add custom order status that they\r\nwould like so that customers can be updated about each step of the\r\norder delivery.</font></font></h4><h4 style=\"margin-bottom: 0cm; line-height: 100%\"><font size=\"3\" face=\"georgia\"><br></font><font size=\"3\" face=\"georgia\"><font><b>Question\r\n: </b></font><font>Can\r\nthe customer save their address once they have ordered from the\r\nwebsite.<br></font></font><font size=\"3\" face=\"georgia\"><font><b>Ans\r\n:</b></font><font>\r\nYes. Customers can save their delivery addresses on the website. Once\r\nthey order their food for the first time, their address is saved.\r\nOrdering again they will be offered to select the previous address.\r\nCustomer can also manage their saved addresses and they can edit or\r\ndelete old addresses.</font></font></h4><h4 style=\"margin-bottom: 0cm; line-height: 100%\"><font size=\"3\" face=\"georgia\"><br></font><font size=\"3\" face=\"georgia\"><font><b>Question\r\n:</b></font><font>\r\nHow will the customer be informed of changed order status?<br></font></font><font size=\"3\" face=\"georgia\"><font><b>Ans\r\n:</b></font><font>\r\nCustomer will receive an email whenever the restaurant owner will\r\nchange the order status on his end.</font></font></h4>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n',1,'2017-09-21 11:29:22','0000-00-00 00:00:00');
