DROP TABLE IF EXISTS `tbl_users`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tbl_users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `restaurant_id` int(11) NOT NULL,
  `delivery_person_id` int(11) NOT NULL,
  `facebook_user_id` varchar(255) NOT NULL,
  `gmail_id` varchar(255) NOT NULL,
  `first_name` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `last_name` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `email_address` varchar(255) CHARACTER SET utf8 NOT NULL,
  `password` varchar(255) CHARACTER SET utf8 NOT NULL,
  `profile_image` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `contact` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `country_id` int(11) DEFAULT NULL,
  `address` varchar(255) CHARACTER SET utf8 DEFAULT NULL,
  `city` int(10) NOT NULL,
  `area` int(10) NOT NULL,
  `deliver_to` text NOT NULL,
  `forget_password_status` tinyint(1) NOT NULL DEFAULT '0',
  `activation_status` tinyint(1) NOT NULL DEFAULT '0',
  `approve_status` tinyint(1) NOT NULL COMMENT 'used to check admin approval',
  `last_login_ip` varchar(50) CHARACTER SET utf8 NOT NULL,
  `online_status` tinyint(1) NOT NULL,
  `availability` enum('0','1') NOT NULL,
  `user_type` enum('Customer','Restaurant','Cuisine','Courier','KitchenStaff','DeliveryPerson') CHARACTER SET utf8 NOT NULL,
  `slug` varchar(255) CHARACTER SET utf8 NOT NULL,
  `lastupdate` date NOT NULL,
  `created` datetime NOT NULL,
  `modified` datetime NOT NULL,
  `paypal_email_address` varchar(255) DEFAULT NULL,
  `unique_name` varchar(255) DEFAULT NULL,
  `status` tinyint(1) NOT NULL,
  `mark_default` tinyint(1) NOT NULL DEFAULT '0',
  `device_id` varchar(255) DEFAULT NULL,
  `device_type` varchar(255) DEFAULT NULL,
  `language` varchar(50) DEFAULT NULL,
  `featured` int(10) NOT NULL DEFAULT '0',
  `plan_id` int(10) NOT NULL DEFAULT '0',
  `expiry_date` datetime DEFAULT NULL,
  `is_busy` enum('0','1') NOT NULL,
  `paypal_username` varchar(255) DEFAULT NULL,
  `paypal_password` varchar(255) DEFAULT NULL,
  `paypal_signature` varchar(255) DEFAULT NULL,
  `food_category` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=157 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

